import React, { Component, Fragment } from "react";

import Movies from "./components/movies";
import "./App.css";
import NavBar from "./components/navBar";

function App() {
  return (
    <ReactFragment>
      <NavBar />
      <main className="container">
        <Movies />
      </main>
    </ReactFragment>
  );
}

export default App;
